export const DEFAULT_START_POSITION = new Vector3(32760, 32760, 15);

export function getGeography(): StateInterface[] {
  return lands.map(({id, name, coordinatesX, coordinatesY}) => {
    let matrix: Uint32Array = new Uint32Array(coordinatesX.length)

    for (let i = 0; i < coordinatesX.length; i++) {
      matrix[i] = encodeCoordinates(coordinatesX[i], coordinatesY[i])
    }

    return {
      id: String(id),
      name,
      status: 'active',
      // width: width,
      // height: height,
      // position: {
      //   x: 0,
      //   y: 0,
      //   z: 0
      // },
      landscape: {
        setup: matrix
      }
    }
  })
}

