export function getCoordinates(position: number): {x: number; z: number } {
  return {
    // tslint:disable-next-line:no-bitwise
    x: (position & 0xffff) - DEFAULT_START_POSITION.x,
    // tslint:disable-next-line:no-bitwise
    z: (position >>> 16) - DEFAULT_START_POSITION.y
  };
}


// https://stackoverflow.com/questions/5291267/using-1-int-to-send-2-numbers
export function encodeCoordinates(x: number, y: number) : number {
  return y << 16 | x
}
